import React from 'react';
import 'antd/dist/antd.css';
import { Layout , Menu, Space } from 'antd';
import { AccountBookOutlined, AppstoreOutlined, SettingOutlined } from '@ant-design/icons';
import { HashRouter, Link } from 'react-router-dom';

export default class Header extends React.Component{

    constructor(props){
        super(props);
    }

    render(){
        return (
            <Layout style={{ width: '100%' }}>                    
                <Space direction="horizontal">
                <Menu theme="dark" mode="horizontal" style={{width: 1200}} defaultSelectedKeys={['1']}>
                        <Menu.Item key="Login" icon={<AppstoreOutlined />}>
                            <HashRouter>
                                <Link to='/LoginControl'> 
                                    Profile 
                                </Link>
                            </HashRouter>
                        </Menu.Item>
                        <Menu.Item key="Market" icon={<AccountBookOutlined />}>
                            <HashRouter>
                                <Link to='/Market'>                                    
                                    Market
                                </Link>
                            </HashRouter>
                        </Menu.Item>
                    </Menu>   
                    <text>真好</text>
                </Space>
            </Layout>
        )
    }
}
